import { CHANGE_LOGIN_STATE } from '../constants/ActionTypes';

const initialState = {
  isLogin: false,
};

const user = (state = initialState, action) => {
  switch (action.type) {
    case CHANGE_LOGIN_STATE:
      return {
        ...state,
        isLogin: !state.isLogin,
      };
    default:
      return state;
  }
};

export default user;
